import React from 'react';
import TableData from '../Data/TableData';
import TableValues from './TableValues';

function Table() {
    return React.createElement(
        'div',
        null,
        React.createElement(
            'table',
            { className: 'table spaced-table table-borderless' },
            React.createElement(
                'thead',
                null,
                React.createElement(
                    'tr',
                    null,
                    React.createElement(
                        'th',
                        { scope: 'col' },
                        React.createElement(
                            'div',
                            { className: 'form-check' },
                            React.createElement('input', {
                                className: 'form-check-input',
                                type: 'checkbox',
                                value: '',
                                id: 'flexCheckDefault',
                            })
                        )
                    ),
                    React.createElement('th', { scope: 'col' }, 'Invoice ID'),
                    React.createElement('th', { scope: 'col' }, 'Date'),
                    React.createElement('th', { scope: 'col' }, 'Customer'),
                    React.createElement('th', { scope: 'col' }, 'Payable Amount'),
                    React.createElement('th', { scope: 'col' }, 'Paid Amount'),
                    React.createElement('th', { scope: 'col' }, 'Due')
                )
            ),
            React.createElement(
                'tbody',
                null,
                TableData.map((e, i) =>
                    React.createElement(TableValues, { data: e, key: i })
                )
            )
        )
    );
}

export default Table;
